import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import Card from '@material-ui/core/Card';
import CardActions from '@material-ui/core/CardActions';
import CardContent from '@material-ui/core/CardContent';
import FavoriteIcon from '@material-ui/icons/Favorite';
import ShareIcon from '@material-ui/icons/Share';
import IconButton from '@material-ui/core/IconButton';
import Typography from '@material-ui/core/Typography';
import Grid from '@material-ui/core/Grid';
import Rating from '@material-ui/lab/Rating';
import Divider from '@material-ui/core/Divider';
import Chip from '@material-ui/core/Chip';
import Button from '@material-ui/core/Button';

import './CustomCard.css';

const useStyles = makeStyles({
  root: {
    width: 275,
    marginBottom: 20,
  },
  bullet: {
    display: 'inline-block',
    margin: '0 2px',
    transform: 'scale(0.8)',
  },
  image: {
    maxWidth: '100%',
  },
  content: {
    paddingBottom: 0,
  },
});

function CustomCard(props) {
  const classes = useStyles();

  return (
    <Card className={classes.root} variant="outlined">
      <CardContent className={classes.content}>
        <Grid container alignItems="center">
          <Grid item xs>
            <Typography color="textSecondary" gutterBottom>
              {props.product.type}
            </Typography>
          </Grid>
          <Grid item>
            <Rating name="read-only" value={props.product.rating} precision={0.5} readOnly />
          </Grid>
        </Grid>
        <img src={'https://external-content.duckduckgo.com/iu/?u=https%3A%2F%2Fukmadcat.com%2Fwp-content%2Fuploads%2F2019%2F04%2Fsleepy-cat.jpg&f=1&nofb=1'} className={classes.image} alt="" />
        <Grid container alignItems="center">
          <Grid item xs>
            <Typography gutterBottom variant="h6">
              {props.product.name}
            </Typography>
          </Grid>
          <Grid item>
            <Typography gutterBottom variant="h6">
            {props.product.price}$
            </Typography>
          </Grid>
        </Grid>
        <Typography color="textSecondary">
        {props.pr}
        </Typography>
      </CardContent>
      <CardActions disableSpacing>
        <Grid container alignItems="center">
          <Grid item xs>
            <Button color="primary">Add to cart</Button>
          </Grid>
          <Grid item>
            <IconButton aria-label="add to favorites">
              <FavoriteIcon />
            </IconButton>
            <IconButton aria-label="share">
              <ShareIcon />
            </IconButton>
          </Grid>
        </Grid>
      </CardActions>
    </Card>
  );
}
export default CustomCard;
